import React from 'react';

class OtherWeatherData extends React.Component {
  render() {
    if(this.props.data.main) {
      return(
        <div className="otherWeatherData">
          <div className="windSpeed">
            {this.props.data.wind.speed}
          </div>
          <div className="left-block">
            <h3>{this.props.data.visibility}<br/>Visibility</h3>
            <p>Visibility</p>
            <br/>
            <h3>{this.props.data.main.pressure}</h3>
            <p>Pressure</p>
            <br/>
          </div>
          {/* <p>Humidity: {this.props.data.main.humidity} %</p>
          <p>Wind: {this.props.data.wind.speed} km/hr</p> */}
        </div>
      );
    } else return null;
  }
}

export default OtherWeatherData;
